import React from 'react';
import './App.css';

function App() {
  const message = "Hello from BridgeLabz";
  const logoUrl = "https://images.yourstory.com/cs/images/companies/logo-1586419574337.jpg?fm=auto&ar=1%3A1&mode=fill&fill=solid&fill-color=fff&format=auto&w=384&q=75";

  const handleLogoClick = () => {
    window.open("https://www.bridgelabz.com", "_blank");
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>{message}</h1>
        <img src={logoUrl} alt="BridgeLabz Logo" className="logo" onClick={handleLogoClick}/>
      </header>
    </div>
  );
}

export default App;
